import './Banner.css'

function Banner() {
  return (
    <div class="banner-content">
            <img class="banner-image" src="/images/banner.png" alt="banner Champions"/>
            <div class="banner-text">Live Football</div>
            <div class="banner-button-container">
                <button class="banner-button" id="live_picker_button">LIVE</button>
                <button class="banner-button" id="date_picker_button">DATE</button>
            </div>
        </div>
  );
}

export default Banner;
